const INITIAL_STATE = {
    list:[]
}
console.log("o que vem em INITIALstate", INITIAL_STATE)
export default (state = INITIAL_STATE, action) =>{
    switch(action.type){
        case 'ADD_ITEM':
            console.log("o que vem aqui?", action.data)
           return INITIAL_STATE.list.push(action.data)
        default:
            return state
    }
}
